        width: 60%;
        margin: 0 auto;
      
    `
    const Input=styled.input`
          padding: 15px;
          box-shadow: -5px 20px 8px -10px rgba(34, 60, 80, 0.41);
    `
    return(
        <Main>
            <Input placeholder={"Add Task"}>
            </Input>
            <Tasks></Tasks>
        </Main>
    )
}

